■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>デンマーク産の最高級プラセンタ濃縮原末使用!!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5426/1070810-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【お召がり方】<br>1日3～4粒を目安に、水またはぬるま湯でお召し上がりください。<br><br>【ご注意】<br>食品アレルギーのある方はお召あがらないでください。<br>体質に合わない場合は本品のご飲用をおやめください。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="450" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5426/1070810-02.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">プラセンタの水分や不純物を取り除き、濃縮し、1カプセル中(200mg)に200mgのプラセンタ原末が含まれてます。200mgの原末は3500mgのプラセンタから作られております。</font></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td><td width="75%"><font color="#333333" size="-1">【1日目安量4粒(0.8g)あたり】<br>エネルギー:17.6kcal、たんぱく質:1.3g、脂質:1.2g、炭水化物:0.3g、ナトリウム:18mg<br>プラセンタ原末:800mg</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">名称：プラセンタ原末含有食品<br>プラセンタ原末、サフラワー油、オリーブ油、ゼラチン、グリセリン、ミツロウ、グリセリン脂肪酸エステル</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><!--アレルギー表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr><td align="center" bgcolor="#FFFFCC" colspan="27"><font color="#333333" size="-1">アレルギー表示（原材料の一部に以下を含んでいます）</font></td></tr><tr><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">卵</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">乳</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">小麦</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">そば</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">落花生</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">えび</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">かに</font></td></tr><tr bgcolor="#FFFFFF"><td width="10%" align="center"><font color="#333333" size="-1">　</font></td><td width="10%" align="center"><font color="#333333" size="-1">　</font></td><td width="10%" align="center"><font color="#333333" size="-1">　</font></td><td width="10%" align="center"><font color="#333333" size="-1">　</font></td><td width="10%" align="center"><font color="#333333" size="-1">　</font></td><td width="10%" align="center"><font color="#333333" size="-1">　</font></td><td width="10%" align="center"><font color="#333333" size="-1">　</font></td></tr></table><br><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><!--あわびから牛肉まで--><tr><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">あわび</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">いか</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">いくら</font></td><td width="10%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">オレンジ</font></t