■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>プラセンタ原液100％をそのままボトルに詰めました。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5401/1062202-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【ご使用方法】<br>適量を取り、顔全体に塗布し、軽く押さえるようになじませてください。<br><br>【使用上の注意】<br>※傷やはれもの、湿疹等の異常がある部分にはお使いにならないでください。<br>※化粧品がお肌に合わないとき、即ち次の場合にはご使用をおやめください。<br>(1)使用中、赤味・はれ・かゆみ・刺激等の異常があらわれた場合。<br>(2)使用したお肌に直射日光があたって上記のような症状があらわれた場合。<br>そのまま使用を続けますと症状を悪化させることがありますので、専門医へのご相談をお勧めします。<br><br>【保管方法】<br>※極端に高温又は低温の場所や、直射日光のあたる場所には保管しないでください。<br>※開封後は冷蔵保存してください。<br>※乳幼児の手の届かない所に保管してください。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">胎盤は新しい命を育てるための器官で、豊富なアミノ酸やビタミン類をはじめ、成長に必要な成分が含まれています。ラ・デェス・プラセンタ原液は「低湿抽出法」で時間と手間を掛け、美容成分を抽出しました。また、大切な成分が十分に活躍できる「低分子」にこだわりました。プラセンタを角質層から肌の深部まで浸透させるために、洗顔後のお肌に最初にご使用ください。肌にうるおい・ハリ・ツヤをあたえます。</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">胎盤は新しい命を育てるための器官で、豊富なアミノ酸やビタミン類をはじめ、成長に必要な成分が含まれています。ラ・デェス・プラセンタ原液は「低湿抽出法」で時間と手間を掛け、美容成分を抽出しました。また、大切な成分が十分に活躍できる「低分子」にこだわりました。プラセンタを角質層から肌の深部まで浸透させるために、洗顔後のお肌に最初にご使用ください。肌にうるおい・ハリ・ツヤをあたえます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：3×6×9cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：110g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分：化粧品</font><br><font color="#333333" size="-1">メーカー名：エーエフシー</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">水、プラセンタエキス、フェノキシエタノール、プロピルパラベン、メチルパラベン<br>※保存料は、デリケートで傷みやすいプラセンタの品質を保持するために原料製造段階で添加されている成分です。<br>※水は、プラセンタ原液にもともと含まれる水分です。</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">セット内容</font></td><td align="left"><font color="#333333" size="-1">15ml×2瓶</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
